import React from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import MyTeam from './myteam/index.js'; // Adjust the path as needed
import './App.css';

function App() {
  return (
    <Router>
      <Route path="/" element={<MyTeam />} />
    </Router>
  );
}

export default App;
